import {
  Card,
  TextField,
  Typography,
  FormGroup,
  FormControlLabel,
  Checkbox,
  Divider,
  Box,
  Tabs,
  Tab,
} from "@mui/material";
import React from "react";
import CheckBoxOutlineBlankIcon from "@mui/icons-material/CheckBoxOutlineBlank";

const QuestionCreator = () => {
  return (
    <Card
      sx={{
        p: 2,
        width: { sm: 410, lg: 550, xs: 310 },
        maxWidth: 700,
        minWidth: 200,
        mt: 2,
        mb: 3,
      }}
    >
      <Tabs variant="fullWidth" aria-label="basic tabs example">
        <Tab label="Item One" />
        <Tab label="Item Two" />
      </Tabs>
      <TextField
        fullWidth
        placeholder="Dodaj pytanie"
        label="Pytanie"
        variant="standard"
        sx={{ mb: 2 }}
      ></TextField>
      <FormGroup>
        <FormControlLabel
          sx={{ mb: 0.5 }}
          control={<Checkbox className="creatorCheckbox" name="1" />}
          label={
            <TextField
              className="creatorTextField"
              label="Odpowiedź"
              variant="standard"
            ></TextField>
          }
        />
        <FormControlLabel
          sx={{ mb: 0.5 }}
          control={<Checkbox className="creatorCheckbox" name="1" />}
          label={
            <TextField
              className="creatorTextField"
              label="Odpowiedź"
              variant="standard"
            ></TextField>
          }
        />
        <FormControlLabel
          sx={{ mb: 0.5 }}
          control={<Checkbox className="creatorCheckbox" name="1" />}
          label={
            <TextField
              className="creatorTextField"
              label="Odpowiedź"
              variant="standard"
            ></TextField>
          }
        />
        <FormControlLabel
          sx={{ mb: 0.5 }}
          control={<Checkbox className="creatorCheckbox" name="1" />}
          label={
            <TextField
              className="creatorTextField"
              label="Odpowiedź"
              variant="standard"
            ></TextField>
          }
        />
      </FormGroup>
    </Card>
  );
};

export default QuestionCreator;
